    #===========================================================================
    # Define all the diesel tanks in the model.
    #===========================================================================
    # They will later be assigned to generators when they get built.  Note that
    # the specifications DB can be accessed via the Driver as shown.
    #
    # This is the first example of defining a specified type.  Note the
    # stipulation of "base_spec" and "specs".  "base_spec" is a singular spec
    # but "specs" can be singular or a list of specs (or names of specs).
    #
    # Also note the inclusion of a loc argument.  Components that appear on the
    # diagram may be given locations.  It is only useful if you intend to save
    # the input or output to a file and open it in the MDT GUI at some point.
    dtSpec = pymdt.utils.FindEntityByName(drv.DieselTankSpecifications, "DT1000")
    tankGT5 = MakeDieselTank(
        mg, "GT5", base_spec=dtSpec, specs=dtSpec, infinite_fuel=True,
        loc=(524.2, 560.7)
        )
    #===========================================================================





    #===========================================================================
    # Create all busses and add them to the Microgrid.
    #===========================================================================
    # The MakeBus function will add the new busses into the MDT.
    bus4 = MakeBus(mg, "4", loc=(241.3, 342.6))
    #===========================================================================





    #===========================================================================
    # Create a solar generator and add it to busFA.  Note in this case we
    # specify the names of the specs rather than finding instances.
    #===========================================================================
    sGen = MakeSolarGenerator(
        bus4, "SGen1", base_spec="PV_VC_250kw", specs="PV_VC_250kw",
        resource="Solar Resource 1", loc=(110.7, 27.3)
        )
    #===========================================================================




    
    #===========================================================================
    # Create all diesel generators and add them to their busses.
    #===========================================================================
    # Also pair all diesel generators with diesel tanks which can be done in
    # the Make function as shown or separately after if desired.
    dg5 = MakeDieselGenerator(
        bus4, "G5", tanks=tankGT5, base_spec="DG5000-12470V",
        specs="DG5000-12470V", loc=(374.2, 560.7)
        )
    #===========================================================================





    #===========================================================================
    # Create loads.
    #===========================================================================
    # Load sections can have multiple data sets of different tiers.  So they are
    # created and then load data is added subsequently.
    ls4 = MakeLoadSection(
        bus4, "L4", period=1, period_units=time_units.hours, interval=1,
        interval_units=time_units.years, loc=(110.7, 342.6)
        )

    data = [random.random() * 100.0 for _ in range(8760)]
    MakeLoadDataTier(ls4, "All", tier="Critical, Uninterruptible", data=data)
    #===========================================================================





    #===========================================================================
    # Create the lines connecting all assets in the grid.
    #===========================================================================
    lSpec = pymdt.utils.FindEntityByName(drv.LineSpecifications, "C4-5")
    MakeLine(mg, None, sGen, bus4, length=990.0, base_spec=lSpec, specs=lSpec)
    MakeLine(mg, None, dg5, bus4, length=990.0, base_spec=lSpec, specs=lSpec)
    MakeLine(mg, None, ls4, bus4, length=990.0, base_spec=lSpec, specs=lSpec)
    #===========================================================================





    #===========================================================================
    # Edit and/or Define Metrics for the Optimization
    #===========================================================================
    # The purchase cost constraint is added to the MDT automatically and so will
    # be there unless previously, explicitly removed.  We can access it as below
    # and configure it the way we want.
    costCon = mg.get_CostConstraint()
    costCon.SingleValueLimit = 1000000
    costCon.SingleValueObjective = 800000
    
    # Now add another metric for maximization of energy availability
    eaCon = pymdt.metrics.MakeEnergyAvailabilityMetric(
        mg, "Energy Availability", limit=90, objective=100,
        tier="Critical, Uninterruptible"
        )

    # Now add the needed response function groups that will be objectives for
    # the solver.  Provide the metrics to be in them as part of the call.
    pymdt.metrics.MakeResponseFunctionGroup(drv.Solver, "Cost", costCon)
    pymdt.metrics.MakeResponseFunctionGroup(drv.Solver, "Performance", eaCon)
    #===========================================================================



    
    #===========================================================================
    # If desired, save the inputs to an input file that can be loaded by MDT.
    #===========================================================================
    pymdt.io.WriteInputFile("C:/temp/pythonrun.mbf")
    #===========================================================================




    
    #===========================================================================
